                          />
                          --
                          <DatePicker
                              showTime={{defaultValue:moment('23:59:59','HH:mm:ss')}}
                              format="YYYY-MM-DD HH:mm:ss"
                              placeholder="结束时间"
                              // value={this.state.searchEndTime}
                              onChange={(e) =>this.searchApplyEndTime(e)}
                              onOk={onOk}
                          />
                      </li>
                      <li>
                          <span style={{marginRight:'10px'}}>退款到账时间</span>
                          <DatePicker
                              showTime={{defaultValue:moment('00:00:00','HH:mm:ss')}}
                              format="YYYY-MM-DD HH:mm:ss"
                              placeholder="开始时间"
                              onChange={(e) =>this.searchTime(e)}
                              onOk={onOk}
                          />
                          --
                          <DatePicker
                              showTime={{defaultValue:moment('23:59:59','HH:mm:ss')}}
                              format="YYYY-MM-DD HH:mm:ss"
                              placeholder="结束时间"
                              // value={this.state.searchEndTime}
                              onChange={(e) =>this.searchTime2(e)}
                              onOk={onOk}
                          />
                      </li>
                      <li style={{marginLeft:'40px'}}>
                          <Button icon="search" type="primary" onClick={() => this.onSearch()}>搜索</Button>
                      </li>
                      <li>
                          <Button icon="download" type="primary" onClick={() => this.onExport()}>导出</Button>
                      </li>
                   </ul>
              </div>
              <div className="system-table">
                <Table
                    columns={this.makeColumns()}
                    dataSource={this.makeData(this.state.data)}
                    scroll={{ x: 2000 }}
                    pagination={{
                        total: this.state.total,
                        current: this.state.pageNum,
                        pageSize: this.state.pageSize,
                        showQuickJumper: true,
                        showTotal: (total, range) => `共 ${total} 条数据`,
                        onChange: (page, pageSize) => this.onTablePageChange(page, pageSize)
                    }}
                />
              </div>
                <Modal
                    title='查看地区'
                    visible={this.state.addnewModalShow}
                    onOk={() => this.onAddNewOk()}
                    onCancel={() => this.onAddNewClose()}
                    confirmLoading={this.state.addnewLoading}
                >
                    <Form>
                        <FormItem
                            label="服务站地区"
                            {...formItemLayout}
                        >
                        <span style={{ color: '#888' }}>
                            {(this.state.nowData && this.state.addOrUp === 'up' && this.state.nowData.province && this.state.nowData.city && this.state.nowData.region) ? `${this.state.nowData.province}/${this.state.nowData.city}/${this.state.nowData.region}` : null}
                        </span>
                            {getFieldDecorator('addnewCitys', {
                                initialValue: undefined,
                                rules: [
                                    {required: true, message: '请选择区域'},
                                ],
                            })(
                                <Cascader
                                    placeholder="请选择服务区域"
                                    options={this.state.citys}
                                    loadData={(e) => this.getAllCitySon(e)}
                                />
                            )}
                        </FormItem>
                    </Form>
                </Modal>
                {/* 查看详情模态框 */}
              <Modal
                  title="查看详情"
                  visible={this.state.queryModalShow}
                  onOk={() => this.onQueryModalClose()}
                  onCancel={() => this.onQueryModalClose()}
                  onChange={() => this.onQueryClick()}
                  wrapClassName={"list"}
              >
                <Form>
                    <FormItem
                        label="订单号"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.orderNo : ''}
                    </FormItem>
                    <FormItem
                        label="退款状态"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.getListByModelId(this.state.nowData.activityStatus) : ''}
                    </FormItem>
                    <FormItem
                        label="用户类型"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.getUserType(this.state.nowData.userType) : ''}
                    </FormItem>
                    <FormItem
                        label="用户id"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.userId : ''}
                    </FormItem>
                    <FormItem
                        label="活动方式"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.getActivity(this.state.nowData.activityType) : ''}
                    </FormItem>
                    <FormItem
                        label="产品类型"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.findProductNameById(this.state.nowData.typeId) : ''}
                    </FormItem>
                    <FormItem
                        label="产品公司"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.Productcompany(this.state.nowData.company) : ''}
                    </FormItem>
                    <FormItem
                        label="产品型号"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.modelType : ''}
                    </FormItem>
                    <FormItem
                        label="产品名称"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.name : ''}
                    </FormItem>
                    <FormItem
                        label="数量"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.count : ''}
                    </FormItem>
                    <FormItem
                        label="订单总金额"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? `￥${this.state.nowData.fee}` : ''}
                    </FormItem>
                    <FormItem
                        label="流水号"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.mchOrderId : ''}
                    </FormItem>
                    <FormItem
                        label="申请退款时间"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.auditTime : ''}
                    </FormItem>
                    <FormItem
                        label="退款到账时间"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.createTime : ''}
                    </FormItem>
                </Form>
              </Modal>
            </div>
        );
    }
}

// ==================
// PropTypes
// ==================

Category.propTypes = {
    location: P.any,
    history: P.any,
    actions: P.any,
    citys: P.array, // 动态加载的省
};

// ==================
// Export
// ==================
const WrappedHorizontalRole = Form.create()(Category);
export default connect(
    (state) => ({
        citys: state.sys.citys,
    }),
    (dispatch) => ({
        actions: bindActionCreators({ findProductTypeByWhere,onChange,onOk,refundList}, dispatch),
    })
)(WrappedHorizontalRole);
